import './App.css';
import  './users.json'
import Navbar from './Components/Navbar';
import Card from './Components/Card';
import Body from './Components/Body';
import Slider from './Components/Slider';

let data = require('./users.json');
console.log(data);
var now = new Date().getTime();
var result={"users":[]};
for(let name in data["users"]){
  if(now<new Date(name["DOB"]).getTime()) {
      result["users"].push(name);
  }
}
console.log(result);

function App() {
  return (<>
  <Navbar  title="Mysite"  />
  <Slider />
  <div className="container my-3"><Body users={data}/></div>



  </>
  );
}

export default App;
